        public static MultiPrecision<Pow2.N16> Nearp5Value(MultiPrecision<Pow2.N16> x) {
            if (!(x >= 0.5 && x <= 0.75)) {
                return MultiPrecision<Pow2.N16>.NaN;
            }

            MultiPrecision<Pow2.N16> y;
            if (x <= 0.5625) {
                y = ApproxUtil<Pow2.N16>.Pade(x - 0.53125, pade_nearp5_0p5_0p5625);
