        public static MultiPrecision<Pow2.N16> Value(MultiPrecision<Pow2.N16> x, bool complementary = false) {
            if (!(x >= 0 && x <= 1)) {
                return MultiPrecision<Pow2.N16>.NaN;
            }

            if (!complementary && x >= 0.5 && x <= 0.75) {
                return Nearp5Value(x);
            }

            if (complementary && x >= 0.25 && x <= 0.5) {
                return Nearp5Value(1 - x);
            }

            if (x > 0.5) {
                complementary = !complementary;
                x = 1 - x;
            }

            if (x == 0) {
                return MultiPrecision<Pow2.N16>.PositiveInfinity;
            }

            MultiPrecision<Pow2.N16> u = -MultiPrecision<Pow2.N16>.Log2(x);

            if (!complementary) {
                MultiPrecision<Pow2.N16> y = MinusLogLogValue(u);

                return y;
            }
            else {
                MultiPrecision<Pow2.N16> y = MultiPrecision<Pow2.N16>.Pow2(PlusLogLogValue(u)) - 1;

                return y;
            }
        }
